import { Text } from "./Text";

export default {
    title: "Components/Text",
    component: Text
} as ComponentMeta<typeof Text>;

const Template: ComponentStory<typeof Text> = (args) => <Text {...args} />;

export const Headings = Template.bind({});

H1.args = {
    type: "h1",
